import express, { Express, Request, Response } from "express";
import dotenv from "dotenv";
import bodyParser from "body-parser";
import cors from "cors";
import path from "path";

import { PrismaClient } from "@prisma/client";
import { resourceUsage } from "process";
const prisma = new PrismaClient();

dotenv.config();

const app: Express = express();
const port = process.env.PORT || 3000;

app.use(express.static(path.join(__dirname, "../public")));
app.use(bodyParser.json());
app.use(bodyParser.urlencoded({ extended: false }));
app.use(cors());

app.get("/", (req: Request, res: Response) => {
  res.send("Express + TypeScript Server");
});

app.post("/draft", async (req: Request, res: Response) => {
  const {
    otherEntityNames = null,
    entityLocalAddress = null,
    entityHeadQuarterAddress = null,
    entityContact = null,
    entityDirectParent = null,
    entityUltimateParent = null,
    ...restEntity
  } = req.body;

  // Upsert Entity relation for Draft
  await prisma.draftEntity.upsert({
    where: { entityId: restEntity.entityId },
    create: {
      ...restEntity,
    },
    update: {
      ...restEntity,
    },
  });

  // Draft if entity's Other names exists then put it in db
  if (otherEntityNames && otherEntityNames.length !== 0) {
    for (let entityName of otherEntityNames) {
      await prisma.draftOtherEntityNames.upsert({
        where: { id: entityName.id },
        create: {
          entityId: restEntity.entityId,
          ...entityName,
        },
        update: { ...entityName },
      });
    }
  }

  // Draft entity Local address
  if (entityLocalAddress && Object.keys(entityLocalAddress).length !== 0) {
    await prisma.draftEntityLocalAddress.upsert({
      where: { id: entityLocalAddress.id },
      create: {
        entityId: restEntity.entityId,
        ...entityLocalAddress,
      },
      update: { ...entityLocalAddress },
    });
  }

  // Draft entity Head Quarter address
  if (
    entityHeadQuarterAddress &&
    Object.keys(entityHeadQuarterAddress).length !== 0
  ) {
    await prisma.draftEntityHeadQuarterAddress.upsert({
      where: { id: entityHeadQuarterAddress.id },
      create: {
        entityId: restEntity.entityId,
        ...entityHeadQuarterAddress,
      },
      update: { ...entityHeadQuarterAddress },
    });
  }

  // Draft contact details for an entity
  if (entityContact && Object.keys(entityContact).length !== 0) {
    await prisma.draftEntityContact.upsert({
      where: { id: entityContact.id },
      create: {
        entityId: restEntity.entityId,
        ...entityContact,
      },
      update: { ...entityContact },
    });
  }

  // create entity direct parent
  if (entityDirectParent) {
    if (entityDirectParent.haveLei == true) {
      await prisma.draftEntityDirectParent.upsert({
        where: { id: entityDirectParent.id },
        create: {
          entityId: restEntity.entityId,
          haveLei: entityDirectParent.haveLei,
          leiNumber: entityDirectParent.leiNumber,
          accountingStandared: entityDirectParent.accountingStandared ?? null,
          accountingStatus: entityDirectParent.accountingStatus ?? null,
          AccountingStartDate: entityDirectParent.AccountingStartDate ?? null,
          AccountingEndDate: entityDirectParent.AccountingEndDate ?? null,
          percentageOwned: entityDirectParent.percentageOwned ?? null,
          directRelationshipTimePeriod: {
            create: entityDirectParent.directRelationshipTimePeriod?.map(
              (period: any) => {
                return {
                  RelationshipStartDate: period.RelationshipStartDate,
                  RelationshipEndDate: period.RelationshipEndDate,
                  periodType: period.periodType,
                };
              }
            ),
          },
        },
        update: {
          haveLei: entityDirectParent.haveLei,
          leiNumber: entityDirectParent.leiNumber,
          accountingStandared: entityDirectParent.accountingStandared ?? null,
          accountingStatus: entityDirectParent.accountingStatus ?? null,
          AccountingStartDate: entityDirectParent.AccountingStartDate ?? null,
          AccountingEndDate: entityDirectParent.AccountingEndDate ?? null,
          percentageOwned: entityDirectParent.percentageOwned ?? null,
          directRelationshipTimePeriod: {
            create: entityDirectParent.directRelationshipTimePeriod?.map(
              (period: any) => {
                return {
                  RelationshipStartDate: period.RelationshipStartDate,
                  RelationshipEndDate: period.RelationshipEndDate,
                  periodType: period.periodType,
                };
              }
            ),
          },
        },
      });
    } else if (entityDirectParent.haveLei == false) {
      await prisma.draftEntityDirectParent.upsert({
        where: { id: entityDirectParent.id },
        create: {
          entityId: restEntity.entityId,
          haveLei: entityDirectParent.haveLei,
          leiReason: entityDirectParent.leiReason,
        },
        update: {
          entityId: restEntity.entityId,
          haveLei: entityDirectParent.haveLei,
          leiReason: entityDirectParent.leiReason,
        },
      });
    }
  }

  // create entity ultimate parent
  if (entityUltimateParent) {
    if (entityUltimateParent.haveLei == true) {
      await prisma.draftEntityUltimateParent.upsert({
        where: { id: entityUltimateParent.id },
        create: {
          entityId: restEntity.entityId,
          haveLei: entityUltimateParent.haveLei,
          leiNumber: entityUltimateParent.leiNumber,
          accountingStandared: entityUltimateParent.accountingStandared ?? null,
          accountingStatus: entityUltimateParent.accountingStatus ?? null,
          percentageOwned: entityUltimateParent.percentageOwned ?? null,
          utimateRelationshipTimePeriod: {
            create: entityUltimateParent.ultimateRelationshipTimePeriod?.map(
              (period: any) => {
                return {
                  startDate: period.startDate,
                  endDate: period.endDate,
                  periodType: period.periodType,
                };
              }
            ),
          },
        },
        update: {
          entityId: restEntity.entityId,
          haveLei: entityUltimateParent.haveLei,
          leiNumber: entityUltimateParent.leiNumber,
          accountingStandared: entityUltimateParent.accountingStandared ?? null,
          accountingStatus: entityUltimateParent.accountingStatus ?? null,
          percentageOwned: entityUltimateParent.percentageOwned ?? null,
          utimateRelationshipTimePeriod: {
            create: entityUltimateParent.ultimateRelationshipTimePeriod?.map(
              (period: any) => {
                return {
                  startDate: period.startDate,
                  endDate: period.endDate,
                  periodType: period.periodType,
                };
              }
            ),
          },
        },
      });
    } else if (entityUltimateParent.haveLei == false) {
      await prisma.draftEntityUltimateParent.upsert({
        where: { id: entityUltimateParent.id },
        create: {
          entityId: restEntity.entityId,
          haveLei: entityUltimateParent.haveLei,
          leiReason: entityUltimateParent.leiReason,
        },
        update: {
          entityId: restEntity.entityId,
          haveLei: entityUltimateParent.haveLei,
          leiReason: entityUltimateParent.leiReason,
        },
      });
    }
  }

  res.send({ data: "Success response" });
});

